INSERT INTO `kandidat` (`id_kandidat`, `id_ketua`, `id_wakil`, `visi`, `misi`, `slogan`, `foto`, `created_at`, `updated_at`) VALUES
(1, 457, 32, 'Menjadikan osis smk negeri 1 bondowoso sebagai organisasi yang dapat berperan ahktif dalam membangun kerjasama dengan seluruh elemen sekolah, dan berjiwa kepemimpinan serta dapat menjadi wadah dalam membentuk karakter siswa/I smk negeri 1 bondowoso yang berkualitas, berprestasidan sesuai dengan pancasila.', 'Mengutamakan nilai ketuhanan yang maha esa sebagai landasan dalam menjalankan kegiatan osis. |\r\nMeningkatkan kualitas ekstrakurikuler yang ada dengan upaya pengadaan kegiatan-kegiatan positif yang dapat meningkatkan bakat dan kreativitas siswa/I. |\r\nMeningkatkan rasa kepedulian dan kesadaran siswa terhadap perkembangan teknologi demi memajukan ilmu pengetahuan dan teknologi di kalangan pelajar. |\r\nMengembangkan dan bertanggung jawab penuh terhadap program kerja osis yang sudah terlaksana maupun yang akan terlaksanνα. |\r\nMembangun komunikasi yang efektif antara osis, siswa/I, guru, dan pihak sekolah. |', 'Berbeda untuk satu,bersatu untuk tujuan yang satu', 'YpzhKXS2qMmtfFmUpDTA4UBlzLH2hQwwRn4vgBVG.png', '2023-11-26 10:39:20', '2024-10-05 04:53:16'),
